import React from 'react';

const ImageChangeOnMouseOver = () => {
	return (
		<div>
			<h1>Hello</h1>
			<img src='/static/speakers/bw/Speaker-187.jpg' alt='' />
			&nbsp;
			<h2>Hello Again</h2>
			<img src='/static/speakers/bw/Speaker-1124.jpg' alt='' />
		</div>
	);
};

export default ImageChangeOnMouseOver;
